/**
 * @title ERC20 Airdrop dapp smart contract
 */
contract Airdrops {
    using SafeERC20 for IERC20;

    function Airdrop(
        IERC20 token,
        address[] calldata _addresses,
        uint256 _amount
    ) external returns (uint256) {
        uint256 i = 0;

        while (i < _addresses.length) {
            token.safeTransferFrom(msg.sender, _addresses[i], _amount);
            i += 1;
        }

        return i;
    }
}

